class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function specialPerm($nums) {
        $mod = 1e9 + 7;
        $n = count($nums);
        sort($nums);
        $dp = array_fill(0, 1 << $n, 0);
        $dp[0] = 1;
        for ($mask = 1; $mask < (1 << $n); $mask++) {
            for ($i = 0; $i < $n; $i++) {
                if ($mask & (1 << $i)) {
                    $prevMask = $mask ^ (1 << $i);
                    if ($prevMask == 0) {
                        $dp[$mask] = ($dp[$mask] + 1) % $mod;
                        continue;
                    }
                    for ($j = 0; $j < $n; $j++) {
                        if ($prevMask & (1 << $j)) {
                            if ($nums[$i] % $nums[$j] == 0 || $nums[$j] % $nums[$i] == 0) {
                                $dp[$mask] = ($dp[$mask] + $dp[$prevMask]) % $mod;
                            }
                        }
                    }
                }
            }
        }
        return $dp[(1 << $n) - 1];
    }
}
